// ./ 의 위치: frontend/src/
// ../의 위치: frontend/
import React from 'react';
import './App.css';
import Home from './components/home';
import Board from './components/board';
import Board_MyList from './components/board_mylist';
import Board_Predict from './components/board_predict';
import Board_List from './components/board_list';
import Board_Like from './components/board_like';
import Board_Fav from './components/board_Fav';
import Login from './components/login';
import { Route, Routes } from 'react-router-dom'
import User_list from './components/user_list';
import Company_Basic_List from './components/company_basic_list'
import Write from './components/write';
import IdSearch from './components/idsearch';
import IdSearch_Result from './components/idsearch_result';
import PwSearch from './components/pwsearch';
import PwSearch_Result from './components/pwsearch_result';
import Join from './components/join';
import IdCheck from './components/idcheck';
import Info from './components/info';
import Info_Update from './components/info_update';
import Info_Delete from './components/info_delete';
import PredictTest from './components/predicttest';
import UserInfo from './components/userinfo';
import UserInfo_Update from './components/userinfo_update';
import PwUpdate from './components/pwupdate';
import Bookmark from './components/bookmark';
import MyResume from './components/myresume';
import { ManageAccounts } from '@mui/icons-material';
import Manage from './components/manage';

const App: React.FC = () => {
  return (
    <Routes>
      <Route path='/' element={<Home/>}/> 
      <Route path='/board' element={<Board/>}/> 
      <Route path='/board_MyList' element={<Board_MyList/>}/> 
      <Route path='/board_Predict' element={<Board_Predict/>}/> 
      <Route path='/company_basic_list' element={<Company_Basic_List/>}/>
      <Route path='/board_list' element={<Board_List/>}/> 
      <Route path='/board_like' element={<Board_Like/>}/> 
      <Route path='/board_Fav' element={<Board_Fav/>}/> 
      <Route path='/' element={<Home/>}/>
      <Route path='/user_list' element={<User_list/>}/>
      <Route path='/write' element={<Write/>}/>
      <Route path='/login' element={<Login/>}/>
      <Route path='/idsearch' element={<IdSearch/>}/>
      <Route path='/idsearch_result' element={<IdSearch_Result/>}/>
      <Route path='/pwsearch' element={<PwSearch/>}/>
      <Route path='/pwsearch_result' element={<PwSearch_Result/>}/>
      <Route path='/join' element={<Join/>}/>
      <Route path='/idcheck' element={<IdCheck/>}/>
      <Route path='/info' element={<Info/>}/>
      <Route path='/info_update' element={<Info_Update/>}/>
      <Route path='/info_delete' element={<Info_Delete/>}/>
      <Route path='/predicttest' element={<PredictTest/>}/>
      <Route path='/userinfo' element={<UserInfo/>}/>
      <Route path='/userinfo_update' element={<UserInfo_Update/>}/>
      <Route path='/pwupdate' element={<PwUpdate/>}/>
      <Route path='/bookmark' element={<Bookmark/>}/>
      <Route path='/myresume' element={<MyResume/>}/>
      <Route path='/manage' element={<Manage/>}/>

    </Routes>
  );
}


export default App;
